create or alter procedure sp_GetApplicationsForACRALegalRequest
AS
	declare @ACRA_TRY_COUNT	tinyint
	select @ACRA_TRY_COUNT=convert(tinyint,VALUE)
		from SETTING
		where CODE='ACRA_TRY_COUNT'

	select a.ID,a.TAX_ID_NUMBER,
		case
			when rtrim(isnull(n.NAME,''))='' then isnull(e.NAME_AM,'')
			else n.NAME
		end as NAME
		,isnull(a.IMPORT_ID,0) as IMPORT_ID
	from APPLICATION a
	join NORQ_LEGAL_QUERY_RESULT n
		on n.APPLICATION_ID=a.ID
	left join EREGISTER_QUERY_RESULT e
		on e.APPLICATION_ID=a.ID
	where a.STATUS_ID=3 and a.ACRA_LEGAL_TRY_COUNT<@ACRA_TRY_COUNT
	order by CREATION_DATE
GO

create or alter procedure sp_GetApplicationsForACRARequest
AS
	declare @ACRA_TRY_COUNT	tinyint
	select @ACRA_TRY_COUNT=convert(tinyint,VALUE)
		from SETTING
		where CODE='ACRA_TRY_COUNT'

	select a.ID,n.FIRST_NAME,n.LAST_NAME,n.BIRTH_DATE,n.PASSPORT_NUMBER,n.SOCIAL_CARD_NUMBER,n.ID_CARD_NUMBER
		,isnull(a.IMPORT_ID,0) as IMPORT_ID
	from APPLICATION a
	join NORQ_QUERY_RESULT n
		on n.APPLICATION_ID=a.ID
	where a.STATUS_ID=5 and ACRA_TRY_COUNT<@ACRA_TRY_COUNT
	order by CREATION_DATE
GO

create or alter procedure sp_SaveInitialApplicationFromBank(
	@LOAN_TYPE_ID				char(2),
	@TAX_ID_NUMBER				char(8),
	@COMPANY_NAME				varchar(100)= null,
	@SOCIAL_CARD_NUMBER			char(10),
	@FIRST_NAME_EN				varchar(50)	= null,
	@LAST_NAME_EN				varchar(50)	= null,
	@MOBILE_PHONE				varchar(20) = null,
	@EMAIL						varchar(70) = null,
	@INITIAL_AMOUNT				money,
	@CURRENCY_CODE				char(3),
	@ANNUAL_TURNOVER			money		= null,
	@FACEBOOK					varchar(100)= null,
	@WEBSITE					varchar(100)= null,
	@CURRENT_COUNTRY_CODE		char(2)		= null,
	@CURRENT_STATE_CODE			char(3)		= null,
	@CURRENT_CITY_CODE			char(9)		= null,
	@CURRENT_STREET				varchar(150)= null,
	@CURRENT_BUILDNUM			varchar(30)	= null,
	@CURRENT_APARTMENT			varchar(30)	= null,
	@INDIVIDUAL_COUNTRY_CODE	char(2)		= null,
	@INDIVIDUAL_STATE_CODE		char(3)		= null,
	@INDIVIDUAL_CITY_CODE		char(9)		= null,
	@INDIVIDUAL_STREET			varchar(150)= null,
	@INDIVIDUAL_BUILDNUM		varchar(30)	= null,
	@INDIVIDUAL_APARTMENT		varchar(30)	= null,
	@ACTIVITY_CODE				char(2)		= null,
	@FACTUAL_INDUSTRY_CODE		char(2)		= null,
	@CLIENT_CODE				char(8),
	@ISN						int,
	@IMPORT_ID					int = null
)
AS
	declare @ID uniqueidentifier = newid()
	insert into APPLICATION
		(CREATION_DATE, ID, LOAN_TYPE_ID, TAX_ID_NUMBER, SOCIAL_CARD_NUMBER, FIRST_NAME_EN, LAST_NAME_EN, INITIAL_AMOUNT, CURRENCY_CODE, ISN, CLIENT_CODE, STATUS_ID, SOURCE_ID, ANNUAL_TURNOVER, FACEBOOK, WEBSITE
		, COMPANY_NAME, MOBILE_PHONE, EMAIL
		, CURRENT_COUNTRY_CODE, CURRENT_STATE_CODE, CURRENT_CITY_CODE, CURRENT_STREET, CURRENT_BUILDNUM, CURRENT_APARTMENT
		, INDIVIDUAL_COUNTRY_CODE, INDIVIDUAL_STATE_CODE, INDIVIDUAL_CITY_CODE, INDIVIDUAL_STREET, INDIVIDUAL_BUILDNUM, INDIVIDUAL_APARTMENT
		, ACTIVITY_CODE, FACTUAL_INDUSTRY_CODE, IMPORT_ID)
	values
		(getdate(), @ID, @LOAN_TYPE_ID, @TAX_ID_NUMBER, @SOCIAL_CARD_NUMBER, @FIRST_NAME_EN, @LAST_NAME_EN, @INITIAL_AMOUNT, @CURRENCY_CODE, @ISN, @CLIENT_CODE, 1, 3, @ANNUAL_TURNOVER, @FACEBOOK, @WEBSITE
		, dbo.ahf_ANSI2Unicode(@COMPANY_NAME), @MOBILE_PHONE, @EMAIL
		, @CURRENT_COUNTRY_CODE, @CURRENT_STATE_CODE, @CURRENT_CITY_CODE, dbo.ahf_ANSI2Unicode(@CURRENT_STREET), dbo.ahf_ANSI2Unicode(@CURRENT_BUILDNUM), dbo.ahf_ANSI2Unicode(@CURRENT_APARTMENT)
		, @INDIVIDUAL_COUNTRY_CODE, @INDIVIDUAL_STATE_CODE, @INDIVIDUAL_CITY_CODE, dbo.ahf_ANSI2Unicode(@INDIVIDUAL_STREET), dbo.ahf_ANSI2Unicode(@INDIVIDUAL_BUILDNUM), dbo.ahf_ANSI2Unicode(@INDIVIDUAL_APARTMENT)
		, @ACTIVITY_CODE, @FACTUAL_INDUSTRY_CODE, @IMPORT_ID)
	select @ID
GO

create or alter procedure dbo.sp_SaveMainApplication(
	@APPLICATION_ID 			uniqueidentifier,
	@FINAL_AMOUNT				money			= null,
	@INTEREST					money			= null,
	@REPAYMENT_DAY				tinyint			= null,
	@LOAN_TERM					char(3)			= null,
	@IS_REFINANCING				bit				= null,
	@LOAN_TEMPLATE_CODE			char(4)			= null,
	@OVERDRAFT_TEMPLATE_CODE	char(4)			= null,
	@OPERATION_DETAILS			nvarchar(max),
	@IS_SUBMIT					bit
)
AS
	BEGIN TRANSACTION

	BEGIN TRY
		declare @STATUS_ID tinyint, @USER_ID int, @LOAN_TYPE_ID char(2), @IDENTIFICATION_REASON nvarchar(100), @IMPORT_ID int

		select @STATUS_ID = STATUS_ID, @USER_ID = USER_ID, @LOAN_TYPE_ID = LOAN_TYPE_ID, @IDENTIFICATION_REASON = IDENTIFICATION_REASON
			, @IMPORT_ID = IMPORT_ID
		from dbo.APPLICATION with (updlock) where ID = @APPLICATION_ID

		if @STATUS_ID<>8
			RAISERROR (N'Հայտը տվյալների լրացման կարգավիճակում չէ', 17, 1)

		insert into dbo.APPLICATION_OPERATION_LOG
			(USER_ID, LOAN_TYPE_ID, OPERATION_CODE, APPLICATION_ID, OPERATION_DETAILS)
		values
			(@USER_ID, @LOAN_TYPE_ID, 'EDIT AUTOMATICALLY', @APPLICATION_ID, @OPERATION_DETAILS)

		update dbo.APPLICATION set
			FINAL_AMOUNT			= isnull(@FINAL_AMOUNT,				FINAL_AMOUNT),
			INTEREST				= isnull(@INTEREST,					INTEREST),
			REPAYMENT_DAY			= isnull(@REPAYMENT_DAY,			REPAYMENT_DAY),
			LOAN_TERM				= isnull(@LOAN_TERM,				LOAN_TERM),
			IS_REFINANCING			= isnull(@IS_REFINANCING,			IS_REFINANCING),
			LOAN_TEMPLATE_CODE		= isnull(@LOAN_TEMPLATE_CODE,		LOAN_TEMPLATE_CODE),
			OVERDRAFT_TEMPLATE_CODE	= isnull(@OVERDRAFT_TEMPLATE_CODE,	OVERDRAFT_TEMPLATE_CODE)
		where ID = @APPLICATION_ID

		if @IS_SUBMIT = 1
		begin
			if isnull(@IDENTIFICATION_REASON,'')=''
				execute dbo.sp_ChangeApplicationStatus @APPLICATION_ID, 14 -- authenticated
			else
				execute dbo.sp_ChangeApplicationStatus @APPLICATION_ID, 15 -- not authenticated, sent to branch

			if @IMPORT_ID>0
				update APPLICATION
					set STATUS_ID=19,TO_BE_SYNCHRONIZED=1
				where IMPORT_ID=@IMPORT_ID and ID<>@APPLICATION_ID
		end

		COMMIT TRANSACTION
	END TRY
	BEGIN CATCH
		ROLLBACK TRANSACTION
		declare @ErrorMessage nvarchar(4000) = ERROR_MESSAGE()
		RAISERROR (@ErrorMessage, 17, 1)
	END CATCH
GO
